import React from 'react';
import IconButton from '@mui/material/IconButton';
import Menu from '@mui/icons-material/Menu';

const HamburgerMenuButton = () => {
  return (
    <IconButton>
      <Menu />
    </IconButton>
  );
};

export default HamburgerMenuButton;
